import styled from "styled-components";

export const Container = styled.header`
  background: #fff;
`
export const Content = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  max-width: 900px ;
  margin: 0 auto;
  padding: 1rem;

  h1{
    font-size: 2rem;
  }
`
